// import specific style here
import skillbarStyles from './skillbar.module.scss';

const SkillBar = (props) => {
    return (
        <div className={skillbarStyles.skillBarContainer}>
            <div className={skillbarStyles.skill}>{props.skill}</div>
            <div className={skillbarStyles.statsContainer}>
                <div className={skillbarStyles.stats}></div>
            </div>
            {props.stats}%
            <style jsx>{`
                .stats {
                    animation: expand 3s ease-in;
                }

                @keyframes expand {
                    from {
                      width: 0;
                    }
                    to {
                      width: ${props.stats};
                    }
                }
            `}</style>
        </div>
    )
}

export default SkillBar;

